trailingComments.value:
*
 * @see http://jsonapi.org/format/#document-resource-objects
 * @example
 * let foo = new Resource({
 *   type: 'foo',
 *   id: 2,
 *   attributes: {
 *     content: 'foo'
 *   }
 *   relationships: {
 *     bars: {
 *       data: [
 *         { type: 'bar', id: 1 }
 *       ]
 *     }
 *   }
 * });
 *
 * let bar = new Resource({
 *   type: 'bar',
 *   id: 2,
 *   attributes: {
 *     content: 'hello'
 *   }
 * });
 *
 * foo.setRelationship('bar', bar);
 * foo.setRelationship('bar', bar.getIdentifier());
 * foo.setRelationship('bars', [bar]);
 * foo.unsetRelationship('bar');
 * foo.unsetRelationship('bars');
 *
 * foo.setAttribute('key', 'value');
 * foo.unsetAttribute('key');

*
   * @return {Fields}
   * @example
   * let foo = new Resource({
   *   type: 'foo',
   *   id: 2,
   *   attributes: {
   *     content: 'foo'
   *   }
   *   relationships: {
   *     bars: {
   *       data: [
   *         { type: 'bar', id: 1 }
   *       ]
   *     }
   *   }
   * });
   * // True
   * _.isEqual(foo.flatten() === {
   *   type: 'foo',
   *   id: 2,
   *   content: 'foo',
   *   bars: {
   *     data: [
   *       { type: 'bar', id: 1 }
   *     ]
   *   }
   * });

